-- Name: transactions; Type: TABLE; Schema: public; Owner: seaply
--

CREATE TABLE public.transactions (
    id uuid DEFAULT public.uuid_generate_v4() NOT NULL,
    invoice_number character varying(50) NOT NULL,
    user_id uuid,
    product_id uuid NOT NULL,
    sku_id uuid NOT NULL,
    quantity integer DEFAULT 1,
    account_inputs jsonb NOT NULL,
    account_nickname character varying(200),
    provider_id uuid NOT NULL,
    provider_ref_id character varying(255),
    provider_serial_number character varying(255),
    provider_response jsonb,
    payment_channel_id uuid NOT NULL,
    payment_gateway_ref_id character varying(255),
    promo_id uuid,
    promo_code character varying(50),
    buy_price bigint NOT NULL,
    sell_price bigint NOT NULL,
    discount_amount bigint DEFAULT 0,
    payment_fee bigint DEFAULT 0,
    total_amount bigint NOT NULL,
    profit bigint GENERATED ALWAYS AS (((sell_price - buy_price) - discount_amount)) STORED,
    currency public.currency_code NOT NULL,
    status public.transaction_status DEFAULT 'PENDING'::public.transaction_status,
    payment_status public.payment_status DEFAULT 'UNPAID'::public.payment_status,
    contact_email character varying(255),
    contact_phone character varying(20),
    region public.region_code NOT NULL,
    ip_address inet,
    user_agent text,
    device_id character varying(255),
    paid_at timestamp with time zone,
    processed_at timestamp with time zone,
    completed_at timestamp with time zone,
    expired_at timestamp with time zone,
    created_at timestamp with time zone DEFAULT now(),
    updated_at timestamp with time zone DEFAULT now()
);


ALTER TABLE public.transactions OWNER TO gate;

--

-- Name: transactions transactions_invoice_number_key; Type: CONSTRAINT; Schema: public; Owner: seaply
--

ALTER TABLE ONLY public.transactions
    ADD CONSTRAINT transactions_invoice_number_key UNIQUE (invoice_number);


--

-- Name: transactions transactions_pkey; Type: CONSTRAINT; Schema: public; Owner: seaply
--

ALTER TABLE ONLY public.transactions
    ADD CONSTRAINT transactions_pkey PRIMARY KEY (id);


--

-- Name: idx_transactions_created_at; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_created_at ON public.transactions USING btree (created_at DESC);


--

-- Name: idx_transactions_invoice; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_invoice ON public.transactions USING btree (invoice_number);


--

-- Name: idx_transactions_payment_status; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_payment_status ON public.transactions USING btree (payment_status);


--

-- Name: idx_transactions_product; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_product ON public.transactions USING btree (product_id);


--

-- Name: idx_transactions_provider; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_provider ON public.transactions USING btree (provider_id);


--

-- Name: idx_transactions_region; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_region ON public.transactions USING btree (region);


--

-- Name: idx_transactions_sku; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_sku ON public.transactions USING btree (sku_id);


--

-- Name: idx_transactions_status; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_status ON public.transactions USING btree (status);


--

-- Name: idx_transactions_user; Type: INDEX; Schema: public; Owner: seaply
--

CREATE INDEX idx_transactions_user ON public.transactions USING btree (user_id);


--

-- Name: transactions update_transactions_updated_at; Type: TRIGGER; Schema: public; Owner: seaply
--

CREATE TRIGGER update_transactions_updated_at BEFORE UPDATE ON public.transactions FOR EACH ROW EXECUTE FUNCTION public.update_updated_at_column();


